              "message": "Don't worry, Rohan, we've got you covered. Fasting tests can be stressful, but we'll ensure you're prepared. For your blood pressure (BP) meds, it's generally recommended to take them as prescribed, but it's essential to check with your doctor or pharmacist for specific instructions.\n\nHowever, I'd like to clarify your medication regimen and any potential interactions. To give you accurate guidance, I'll need to consult with our medical expert."
