              "message": "Rohan, considering your irregular travel schedule, let's focus on adapting your routine rather than strictly adjusting your sleep schedule. I recommend trying the \"15-minute rule\": for every 1-hour time difference, try to adjust your sleep schedule by 15 minutes before and after the flight. This might help your body adapt more smoothly."
