              "role": "carla",
              "message": "Rohan, considering your busy travel schedule and reduced sleep hours, I recommend increasing your sodium intake slightly to help regulate fluid balance and reduce fatigue. Aim for an additional 200-300mg of sodium per day. Also, focus on having a balanced snack with protein and complex carbs within 30 minutes of waking up to help stabilize your energy levels."
