              "sender": "carla",
              "role": "carla",
              "message": "For high-protein options, consider these additional choices: \nCanned tuna or chicken for easy sandwiches or salads, \nProtein bars with wholesome ingredients, \nDark chocolate-covered nuts for a boost of protein and healthy fats."
