              "message": "Rohan, given your unique travel schedule, it's essential to focus on strategies that help your body adjust to the new time zones. To start, we can implement a smart travel routine that involves adjusting your sleep schedule a few days before traveling and using light therapy to regulate your circadian rhythms."
