              "message": "Based on your HRV metrics, I've observed a slight decrease in your parasympathetic activity (PSA) over the past week, which could contribute to your low energy levels. Your average heart rate variability (HRV) is 60ms, which is slightly below the normal range (80-100ms). This might indicate stress or fatigue."
