              "message": "Given your busy travel schedule and hypertension, I've curated some short and effective in-room exercises for you. These will help improve blood flow, lower blood pressure, and boost energy. Try these 3 simple exercises:\n\n- Bodyweight squats: 3 sets of 10 reps\n- Chair dips (using a sturdy chair): 3 sets of 10 reps\n- Wall push-ups: 3 sets of 10 reps"
