              "sender": "patient",
              "role": "patient",
              "message": "I've been feeling more fatigued lately, and the frequent travel has definitely been taking a toll. I'll look into incorporating relaxation techniques, such as meditation, into my daily routine. Can you provide more specific exercises or apps that you recommend?"
