              "role": "advik",
              "message": "Considering your busy travel schedule, I recommend starting with short, 5-10 minute meditation sessions using Headspace or Calm apps. These guided meditations can help reduce stress and improve sleep quality. Additionally, I suggest incorporating 5-10 minute deep breathing exercises, focusing on slow and deliberate breaths, to help manage fatigue and stress."
