              "role": "carla",
              "message": "Rohan, since you mentioned fatigue, let's focus on your nutrition. Considering your busy travel schedule, ensure you're consuming a balanced diet with adequate protein, complex carbs, and healthy fats. Aim for 1.6-2 grams of protein per kilogram of body weight daily to support muscle function and recovery."
